CREATE TABLE `Reservation` (
  `id` varchar(36) COLLATE utf8mb4_unicode_ci NOT NULL,
  `createdAt` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
  `updatedAt` datetime(3) NOT NULL,
  `fullName` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL,
  `cpf` varchar(14) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `people` int NOT NULL,
  `reservationDate` datetime(3) NOT NULL,
  `birthdayDate` datetime(3) DEFAULT NULL,
  `phone` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `notes` text COLLATE utf8mb4_unicode_ci,
  `unit` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `source` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `checkedInAt` datetime(3) DEFAULT NULL,
  `qrExpiresAt` datetime(3) DEFAULT NULL,
  `qrToken` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `status` enum('AWAITING_CHECKIN','CHECKED_IN','NO_SHOW') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'AWAITING_CHECKIN',
  `reservationCode` varchar(6) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `checkedInBy` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `kids` int NOT NULL DEFAULT '0',
  `area` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ref` varchar(256) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
