  `utm_campaign` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `utm_content` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `utm_medium` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `utm_source` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `utm_term` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `unitId` varchar(36) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `areaId` varchar(36) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `areaName` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `reservationType` enum('PARTICULAR','CONFRATERNIZACAO','EMPRESA','ANIVERSARIO') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'PARTICULAR',
  PRIMARY KEY (`id`),
  UNIQUE KEY `Reservation_qrToken_key` (`qrToken`),
  UNIQUE KEY `Reservation_reservationCode_key` (`reservationCode`),
  KEY `Reservation_reservationDate_idx` (`reservationDate`),
