  KEY `Reservation_unitId_createdAt_idx` (`unitId`,`createdAt`),
  KEY `Reservation_areaId_createdAt_idx` (`areaId`,`createdAt`),
  CONSTRAINT `Reservation_areaId_fkey` FOREIGN KEY (`areaId`) REFERENCES `Area` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Reservation_unitId_fkey` FOREIGN KEY (`unitId`) REFERENCES `Unit` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
